import React from 'react';
import SvgIcons from '../../components/svg';

export const Generate = () => {
  return (
    <div>
      {/* HEADER */}
      <div className='h-[50px] w-[100%] flex justify-end items-center p-3 gap-5'>
        <button className='text-[12px] text-white font-poppins  flex items-center justify-center bg-[#5C57C3] p-3 px-5 w-[143px] rounded-md cursor-pointer'>
          Order a Service
        </button>
        <div className='h-[22px] w-[22px] rounded-full'>
            <img className='w-full rounded-full h-full object-cover'  src={process.env.PUBLIC_URL + '/images/sm.jpg'} />
        </div>
        <div>
            <SvgIcons.SSupport />
        </div>
      </div>
    </div>
  );
};
